function adjustForNewBounds() {
/*
	this.adjustForNewBounds()
*/
	$super();
	var bounds = this.innerBounds(),
		x = bounds.x,
		y = bounds.y,
		width = bounds.width;
	this.submorphs.forEach(function(morph) {
		var extent = morph.getExtent();
		if (extent.x + x > width) {
			x = 0;
			y += extent.y + 5;
		}
		morph.setPosition(pt(x,y))
		x += extent.x + 5;
	})
}

