function updateCategoriesDictFromPartsBin() {
	this.ensureCategories();
	var webR = new WebResource(this.defaultPartsBinURL());
	webR.getSubElements().subCollections.forEach(function(dir) {
		// FIXME OMeta does something here...!
		var unescape = Global.urlUnescape || Global.unescape,
			unescaped = unescape(dir.getURL().filename()),
			name = unescaped.replace(/\/$/,"");
		this.categories[name] = this.defaultPartsBinURL().withFilename(unescaped);
	}, this);
}

